import React, { useEffect } from 'react';

const Home = ({ increaseHomeVisits }) => {
  useEffect(() => {
    increaseHomeVisits();
  }, [increaseHomeVisits]);

  return (
    <div>
      <h2>Home</h2>
      <p>Display your Banner Id: [Your Banner Id]</p>
    </div>
  );
}

export default Home;
